import React, { Component } from "react";
import './App.css'

var todoItems = [];

const baseURL = "http://localhost:8080";

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      todoList: todoItems
    };
  }

  renderTasks = () => {

    return todoItems.map((item) => (
      <li>
      </li>
    ));
  };

  submitTasks = () =>{
    const postData = {
      todoItems: this.state.todoList
    };

    try {
      const res = fetch(`${baseURL}/task`, {
        method: "post",
        headers: {
          "Content-Type": "application/json",
          "x-access-token": "token-value",
        },
        body: JSON.stringify(postData),
      });

      if (!res.ok) {
        const message = `An error has occured: ${res.status} - ${res.statusText}`;
        throw new Error(message);
      }

      const data = res.json();

      const result = {
        status: res.status + "-" + res.statusText,
        headers: {
          "Content-Type": res.headers.get("Content-Type"),
          "Content-Length": res.headers.get("Content-Length"),
        },
        data: data,
      };
      console.log(result);
    } catch (err) {
      console.log('fucked');
    }
  }


  render() {

    return (
      <div className='App'>
        <header className="App-header">
          <h1> Speeday </h1>
        </header>

        <div className="Tasks">
          <div className="TaskWriter">
            <textarea className="TaskText" rows={10} cols={60}></textarea>
          </div>
          <div className="TaskList"><div className="mb-4">
            <button onSubmit={this.submitTasks()}>
              Submit Tasks
            </button>
          </div>
            {this.renderTasks()}
          </div>

        </div>
      </div >



    );
  }
}

export default App;
